import { Injectable } from '@angular/core';
import {Invoice} from "../dto/invoice";
import {Detail} from "../dto/detail";

@Injectable({
  providedIn: 'root'
})
export class TempServiceService {

  invoiceList:Array<Invoice>=[];

  detailList:Array<Detail>=[];
  constructor() { }
}
